import React, { Component } from 'react';
import DropdownButton from 'react-bootstrap/DropdownButton'

import ResidentName from './ResidentName';
import DateOfBirth from './ResidentDOB';
import MoveInDate from './MoveInDate';
import ResidentCottage from './Cottage';
import ResidentCottage2 from './Cottage2';


class Resident extends Component {
  render() {
    return (
      <div>
        <h3>New Resident Information</h3>
        <div className="row">
            <div className="column">
                <ResidentName />
            </div>
            <div className="column">
                <DateOfBirth/>
            </div>
            <div className="column">
                <MoveInDate/>
            </div>
            <div className="column">
                <ResidentCottage2/>
            </div>
        </div>
    </div>

    );
  }
}

export default Resident;
